import React from 'react';
import {Image,Input} from 'semantic-ui-react';

function App() {
  return (
    <div className="App">
      <div className='logo'>
        <Image src='' size='medium' circular />
      </div>
      <div className='searchInput'>
          <Input icon='users' iconPosition='left' placeholder='Search users...' />
      </div>
    </div>
  );
}

export default App;
